import React, { useState, useEffect } from "react";
import getData from "./axios";

const Getdata = () => {
  useEffect(() => {
    (async () => {
      try {
        let s = await getData("1", "get");
      } catch (err) {
        console.log(err);
      }
    })();
  }, []);
  return (
    <div>
      <h1> hello word</h1>
    </div>
  );
};

export default Getdata;
